INSERT INTO Cuisine_Origins (origin, description, originID) VALUES ('Italian', 'Caprese salad originated in the 1950s on the island of Capri, Italy as a tribute to the colors of the Italian flag.', 1001);
INSERT INTO Cuisine_Origins (origin, description, originID) VALUES ('Middle Eastern', 'Baklava is a sweet pastry that originated in the Middle East and is made with layers of phyllo dough, nuts, and sweet syrup or honey.', 1002);
INSERT INTO Cuisine_Origins (origin, description, originID) VALUES ('Mediterranean', 'Grilling chicken with a lemon and herb marinade is a common cooking method in Mediterranean and Middle Eastern cuisines.', 1003);
INSERT INTO Recipes (title, servings, difficulty, description, originID, categoryID, creatorID, recipeID) VALUES
('Baklava', 12, 'Challenging', 'This vegan baklava recipe is a classic Middle Eastern dessert made with layers of crispy phyllo dough, a sweet and nutty filling, and a fragrant honey or maple syrup glaze, making for a delicious and indulgent treat that is perfect for sharing.', 1002, 5, 1, 1001);
INSERT INTO Recipes (title, servings, difficulty, description, originID, categoryID, creatorID, recipeID) VALUES
('Caprese Salad', 3, 'Easy', 'This easy and simple Caprese salad recipe is a classic Italian dish that features ripe tomatoes, fresh mozzarella, and fragrant basil leaves drizzled with extra-virgin olive oil and seasoned with salt and pepper, making for a light and refreshing appetizer or side dish.', 1001, 1, 3, 1002);
INSERT INTO Recipes (title, servings, difficulty, description, originID, categoryID, creatorID, recipeID) VALUES
('Grilled Lemon-Herb Chicken', 4, 'Moderate', 'This Grilled Lemon-Herb Chicken recipe is a simple and flavorful dairy-free entree that features juicy and tender chicken breasts marinated in a zesty blend of olive oil, lemon, garlic, and fresh herbs.', 1003, 2, 2, 1003);
