INSERT INTO Instructions (cookTime, prepTime, recipeID, instructionID) VALUES (30, 60, 1001, 1001);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Preheat your oven to 350°F (175°C) and grease a 9x13 inch baking pan.', 1001, 1001, 1);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Mix together the chopped nuts, sugar, cinnamon, and lemon zest in a bowl and set aside.', 1001, 1001, 2);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Lay the phyllo dough out flat and cut it to fit the baking pan.', 1001, 1001, 3);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Brush the bottom of the pan with melted butter or coconut oil and lay one layer of phyllo dough on top.', 1001, 1001, 4);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Brush the phyllo dough with melted butter or coconut oil and continue layering phyllo and brushing with butter or oil until you have used about half of the phyllo sheets.', 1001, 1001, 5);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Sprinkle half of the nut mixture over the phyllo layers in the pan.', 1001, 1001, 6);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Layer the remaining phyllo sheets on top of the nut mixture, brushing each layer with butter or oil as before.', 1001, 1001, 7);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Sprinkle the remaining nut mixture over the top layer of phyllo.', 1001, 1001, 8);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Cut the baklava into small squares or diamonds with a sharp knife.', 1001, 1001, 9);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Bake the baklava for 50-60 minutes, or until golden brown and crispy.', 1001, 1001, 10);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('While the baklava is baking, mix together the water, honey or maple syrup, and vanilla extract in a saucepan and bring to a boil. Simmer for 10-15 minutes.', 1001, 1001, 11);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('When the baklava is done, remove it from the oven and immediately pour the hot syrup over the top. Allow the baklava to cool before serving.', 1001, 1001, 12);
