INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Preheat your grill to medium-high heat.', 1003, 1003, 1);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('In a bowl, whisk together the olive oil, lemon juice and zest, garlic, thyme, and rosemary.', 1003, 1003, 2);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Season the chicken breasts with salt and pepper.', 1003, 1003, 3);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Brush the chicken with the marinade and let it sit for at least 15 minutes.', 1003, 1003, 4);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Place the chicken on the grill and cook for 5-6 minutes per side, or until the internal temperature reaches 165°F.', 1003, 1003, 5);
INSERT INTO Instruction_Step (step, instructionID, recipeID, stepNum) VALUES ('Remove the chicken from the grill and let it rest for a few minutes before slicing and serving.', 1003, 1003, 6);
